import React from 'react';
import { Routes, Route, Link, NavLink, useNavigate } from 'react-router-dom';
import './App.css';

function App() {

  return (
    <div>
      <Nav/>
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/people" element={<People/>} />
        <Route path="/planet" element={<Planets/>}/>
        <Route path="/film" element={<Films/>}/>
      </Routes>
    </div>
  );
}

function Home(){
  return(
    <div>
      <h1>Hello! Here, you can look up more information about your favorite Star Wars person, planet or film! Please select from the navbar!</h1>
    </div>
  );
}

function People(){
  return(
      <div>
          <h1>Hi People</h1>
      </div>   
  );
}
function Planets(){
  return(
      <div>
          <h1>Hi Planets</h1>
      </div>
  );
}
function Films(){
  return(
      <div>
          <h1>Hi Film</h1>
      </div>
  );
}
function Nav(){
  return(
    <div>
      <Link to="/">Star Wars Home</Link>
      <Link to="/people">People</Link>
      <Link to="/film">Films</Link>
      <Link to="/planet">Planets</Link>
    </div>
  );
}

export default App;
